import React from 'react';
import Grid from '@material-ui/core/Grid';

const NavigationModule = () => (
    <header>
        <Grid container>
            <Grid item>
                Hello, Paulo!
            </Grid>
        </Grid>
    </header>
);

export default NavigationModule;
